function getTaobaoListInfo() {
  var productList = document.querySelectorAll('#content_items_wrapper .tbpc-col');
  var items = [];
  for (var i = 0; i < productList.length; i++) {
    var product = productList[i];
    let node = product.querySelector('.doubleCardWrapperAdapt--mEcC7olq');
    if (!node) {
      if (product.parentNode.getAttribute("class").indexOf("Card--doubleCardWrapper") != -1) {
        node = product.parentNode;
      }
    }
    if (!node) {
      continue;
    }
    var link = node.getAttribute("href");
    var pid;
    if (link.match(/id=(\d+)/)) {
      pid = link.match(/id=(\d+)/)[1];
    }
    var isTmall = false;
    if (link.match(/detail.tmall.com/)) {
      isTmall = true;
    }
    if (link.match(/click.simba.taobao.com/)) {
      continue;
    }
    if (!pid) {
      pid = product.querySelector('[class*="ShopInfo--wwWrap"]').getAttribute("data-item").trim();
    }
    var price = product.querySelector("[class*=priceInt--]").textContent + product.querySelector("[class*=priceFloat--]").textContent;
    if (!price.match(/[\d\.]+/)) {
      continue;
    }
    var shopName = product.querySelector('[class*="shopName--"]').textContent.trim();
    var shopUrl = product.querySelector('[class*="shopName--"]').getAttribute("href");
    if (shopUrl && shopUrl.match(/user_number_id=(\d+)/)) {
      var shopId = shopUrl.match(/user_number_id=(\d+)/)[1];
    }
    var title = product.querySelector('[class*="title--"]').textContent.trim();
    var imgNode = product.querySelector('[class*="mainPicAndDesc--"]');
    var img;
    if (imgNode) {
      img = getLazyLoadImageUrl(imgNode.querySelector("img"));
    }
    try {
      var saleNumber = fixReviewCount(product.querySelector('[class*="realSales--"]').textContent);
    } catch (e) {
      var saleNumber = 0;
    }
    items.push({
      "nnid": pid,
      "price": price,
      "shopname": shopName,
      "title": title,
      "shopId": shopId,
      "taobao": !isTmall,
      "img": img,
      "sale_num": saleNumber,
      "version": "2023-10-24"
    });
  }
  return items;
}
